import React from 'react';

class StreamList extends React.Component {
  listStreams = () => {
    console.log(stream)
    return this.props.streamInfo.map(stream => <p key={stream.id} name={stream.name} src={stream.url} />)
  }

  render() {
    return (
      <div>
        {this.listStreams()}
        }
      </div>
    )
  }
}

export default StreamList;
